import React, {useState, useEffect} from 'react'
import resultService from './services/results'

function App() {
  const [results, setResults] = useState([])

  useEffect(()=>{
    resultService.getAll().then(res => setResults(res))
  },[])

  const RecentGames = () => {
    return(
      <div>
        <h2>Past Games</h2>
        {
          results.map(g =>{
            return(
              <div>
                <h3>{`Game on ${g.date}`}</h3>
                <li>{`Winner: ${g.winner}`}</li>
              </div>
            )
          })
        }
      </div>
    )
  }


  return (
    <div>
      <h2>Welcome to MKCharts</h2>
      <RecentGames/>
    </div>
  );
}

export default App;
